// Saves the form value in PDF
function createPDF() {
    if (document.getElementById("name").value == "" && document.getElementById("dob").value == "") {
        alert("Please enter all the fields");
    }
    else {
        // create the jspdf document

        var doc = new jsPDF();
        var imgData = 'data:image/jpeg;base64,'

        var PA = document.getElementById("PA").value;
        var Ill = document.getElementById("Ill").value;
        var name = document.getElementById("name").value;
        var dob = document.getElementById("dob").value;
        var Tel = document.getElementById("Tel").value;
        var mobile = document.getElementById("hp").value;
        var email = document.getElementById("email").value;
        var Mr = document.getElementById("Mr").value;
        var Mrs = document.getElementById("Mrs").value;
        var Ms = document.getElementById("Ms").value;

        doc.addImage(imgData, 'JPG', 0, 0, 210, 297);

        doc.setFontSize(12);
        doc.setTextColor(0, 0, 0); //black colour

        if (document.getElementById("Mr").checked) { // radio checked?
            doc.text(Mr, 45.1, 108.9); // if so, hold its value in val
        }
        else if (document.getElementById("Mrs").checked) {
            doc.text(Mrs, 57.5, 108.9);
        }
        else {
            doc.text(Ms, 69.9, 108.9);
        }

        doc.text(PA, 100, 109);
        doc.text(name, 90, 109);
        doc.text(dob, 45.5, 115);
        doc.text(Tel, 50, 126.5);
        doc.text(mobile, 95, 126.5);
        doc.text(email, 143.5, 126.5);

        // save the file
        doc.save("ouput.pdf");
    }
}

// function to display the hidden div
function displayUS(n) {
    /* var x = document.getElementById("hidden"); */
    var x = document.getElementsByClassName("hidden")[n];
    x.style.display = "block";
}

// function to hide the hidden div
function hideUS(n) {
    var y = document.getElementsByClassName("hidden")[n];
    y.style.display = "none";
}
// function to uplod pdf file and display it in HTML
const inpFile = document.getElementById("inpFile");
const btnUpload = document.getElementById("btnUpload");
const resultText = document.getElementById("resultText");

btnUpload.addEventListener("click", () => {
    const formData = new FormData();

    formData.append("pdfFile", inpFile.files[0]);

    fetch("/extract-text", {
        method: "post",
        body: formData
    }).then(response => {
        return response.text();
    }).then(extractedText => {
        resultText.value = extractedText.trim();
    });
});

